import React, { useRef } from "react";
import { useGLTF } from "@react-three/drei";

export default function RoomWithComputer({ ...props }) {
  const group = useRef();
  const { nodes, materials } = useGLTF("/roomwithcomputer.glb");
  return (
    <group ref={group} {...props} dispose={null}>
      <group position={[-0.34, 0.23, -0.7]}>
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Plane.geometry}
          material={materials.metallic}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Plane_1.geometry}
          material={materials.black_wood}
        />
      </group>
      <group position={[-0.31, 0.49, -0.78]}>
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube003.geometry}
          material={materials.blackplastic}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube003_1.geometry}
          material={materials.metallicplastic}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube003_2.geometry}
          material={materials.emission_green}
        />
      </group>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.shelving.geometry}
        material={materials.metallicplastic}
        position={[0.66, 0.73, -0.76]}
      />
      <group position={[-0.71, 0.12, -0.72]}>
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cylinder004.geometry}
          material={materials.trashbucket}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cylinder004_1.geometry}
          material={materials.wall}
        />
      </group>
      <group position={[0.07, 0.01, 0.01]}>
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube011.geometry}
          material={materials.wall}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube011_1.geometry}
          material={materials.wall_black}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube011_2.geometry}
          material={materials.woodside}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube011_3.geometry}
          material={materials.led_emisison_pink}
        />
        <mesh
          castShadow
          receiveShadow
          geometry={nodes.Cube011_4.geometry}
          material={materials.led_emission_blue}
        />
      </group>
      <mesh
        castShadow
        receiveShadow
        geometry={nodes.blinds.geometry}
        material={materials.blackplastic}
        position={[-1.06, 1.42, -0.07]}
      />
